export const getAllCategories = (products) => {
    const filterCategories = []

    products.proData.map((prod) => {
        if(filterCategories.indexOf(prod?.inCategory) !== 1){
            filterCategories = [...filterCategories,prod?.inCategory]
        }
    })

    console.log(filterCategories);
}
